<p style='margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;text-align:justify;'><span style='font-size:13px;font-family:"Arial",sans-serif;'>&nbsp;</span></p>
<p style='margin:0cm;margin-bottom:.0001pt;font-size:16px;font-family:"Times New Roman",serif;text-align:justify;'><span style='font-size:13px;font-family:"Arial",sans-serif;'>As&iacute; mismo, hacemos patente nuestro sincero agradecimiento por su buena disposici&oacute;n y colaboraci&oacute;n para que nuestros estudiantes, a&uacute;n estando en proceso de formaci&oacute;n, desarrollen un proyecto de trabajo profesional, donde puedan aplicar el conocimiento y el trabajo en el campo de acci&oacute;n en el que se desenvolver&aacute;n como futuros profesionistas.</span></p>
